      method: 'POST',
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        user: {
          id: 4,
          username: "cus03456",
          email: "cus03@examplesdasd.com",
          first_name: "Cusssssss",
